import styled from 'styled-components';

const FooterStyles = styled.li`
  #footer {
    display: grid;
    grid-gap: 0;
    padding: 0;
    margin: 0;
    grid-template-columns: 10vw auto auto auto 10vw;
    grid-template-rows: 100vh 25vh 25vh 25vh 25vh;
  }
  
  h1 {
    font-size: 10px;
  }
`;

export default FooterStyles;
